import React, { useState } from 'react';
import Calendar from 'react-calendar'; // Make sure you have this library installed
import './Events.css'; // Import your CSS file for styles

const Events = () => {
    const [date, setDate] = useState(new Date());

    // Sample event data
    const events = [
        {
            id: 1,
            title: 'Goa Carnival',
            description: 'A vibrant celebration with parades and music.',
            date: '2024-09-15',
            img: '../Images/a-1.jpg'
        },
        {
            id: 2,
            title: 'Shigmo Festival',
            description: 'A cultural festival showcasing Goan traditions.',
            date: '2024-09-20',
            img: '../Images/a-2.jpg'
        },
        {
            id: 3,
            title: 'Feast of St. Joseph',
            description: 'Celebrated by the local community with feasting and fun.',
            date: '2024-09-25',
            img: '../Images/a-3.jpg'
        },
        {
            id: 4,
            title: 'Gudi Padwa',
            description: 'A festival celebrating the New Year for the Konkan region.',
            date: '2024-04-09',
            img: '../Images/a-4.jpg'
        },
        {
            id: 5,
            title: 'International Jazz Festival',
            description: 'A gathering of talented musicians performing live jazz.',
            date: '2024-10-15',
            img: '../Images/a-5.jpg'
        },
        {
            id: 6,
            title: 'Sao Joao Festival',
            description: 'A traditional Goan festival where locals jump into wells.',
            date: '2024-06-24',
            img: '../Images/a-6.jpg'
        },
        {
            id: 7,
            title: 'Monsoon Festival',
            description: 'Celebrate the beauty of the monsoons with local cuisine and culture.',
            date: '2024-07-15',
            img: '../Images/a-7.jpg'
        },
        {
            id: 8,
            title: 'Diwali Celebrations',
            description: 'Festival of Lights celebrated with fireworks and sweets.',
            date: '2024-11-12',
            img: '../Images/a-8.jpg'
        },
        {
            id: 9,
            title: 'Christmas Eve Celebration',
            description: 'Join the community for carols, food, and festivities.',
            date: '2024-12-24',
            img: '../Images/a-9.jpg'
        },
        {
            id: 10,
            title: 'Goan Food Festival',
            description: 'Taste a variety of Goan dishes at this annual food festival.',
            date: '2024-01-15',
            img: '../Images/a-10.jpg'
        },
    ];

    const handleDateChange = (newDate) => {
        setDate(newDate);
    };

    const filteredEvents = events.filter(event =>
        new Date(event.date).toDateString() === date.toDateString()
    );

    return (
        <div className="container">
            <div className="calendar-container">
                <h2>Events Calendar</h2>
                <div className="calendar">
                    <Calendar
                        onChange={handleDateChange}
                        value={date}
                    />
                </div>
            </div>

            <div className="main-container">
                <div className="filters">
                    <div className="filter-card" id="date-filter">
                        <h3>Date</h3>
                        <div className="filter-options">
                            <button>Today</button>
                            <button>Tomorrow</button>
                            <button>This Weekend</button>
                        </div>
                    </div>
                    <div className="filter-card" id="category-filter">
                        <h3>Categories</h3>
                        <div className="filter-options">
                            <button>Festivals</button>
                            <button>Music</button>
                            <button>Cultural</button>
                        </div>
                    </div>
                </div>

                <div className="event-cards">
                    {filteredEvents.length > 0 ? (
                        filteredEvents.map(event => (
                            <div key={event.id} className="dispEvent">
                                <img src={event.img} alt={event.title} />
                                <h4>{event.title}</h4>
                                <p>{event.description}</p>
                            </div>
                        ))
                    ) : (
                        <p>No events for this date.</p>
                    )}
                </div>
            </div>
        </div>
    );
};

export default Events;
